import React, { useState, useEffect } from "react";
import { Box, Grid, Typography, Paper, Input } from "@mui/material";

const Frame = (props) => {
const [description, setDescription] = useState("Hellloooo");
  function handleChange(event) {
    const value = event.target.value;
    console.log("this is my target", event.target.value)
    setDescription(value);
  }
  console.log("this is my desc", description)
  return (
    <Paper elevation={2}>
      <Box
        p={2}
        sx={{
          backgroundColor: "#1D5B79",
          borderRadius: "5px",
          marginBottom: "32px",
        }}
      >
        <Grid container rowSpacing={2} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
          {/* Displays Scene number */}
          <Grid item xs={2}>
            <Typography variant="h6" sx={{ color: "white" }}>
              {/* Scene {props.sceneNum} */}
              propu
            </Typography>
          </Grid>
          {/* Displays time stamp */}
          <Grid item xs={1}>
            <Typography
              fontSize="1rem"
              color="white"
              backgroundColor="#EF6262"
              padding="3px"
              borderRadius="5px"
            >
              {/* {props.timeStamp} */}
              hi there
            </Typography>
          </Grid>

          <Grid item xs={3} md={2}>
            <Typography variant="subtitle1" sx={{ color: "white" }}>
              On screen text
            </Typography>
          </Grid>
          <Grid item xs={9} md={10}>
            <Box p={1.5} borderRadius="5px" sx={{ backgroundColor: "white" }}>
              <Typography variant="body1" sx={{ color: "#1D5B79" }}>
                CURRENTLY THEIR IS NO ONSCREEN TEXT, THIS IS HARDCODED
              </Typography>
            </Box>
          </Grid>

          <Grid item xs={3} md={2}>
            <Typography variant="subtitle1" sx={{ color: "white" }}>
              Description
            </Typography>
          </Grid>
          <Grid item xs={9} md={10}>
            <Box p={1.5} borderRadius="5px" sx={{ backgroundColor: "white" }}>
              <Input
                name="desc"
                onChange={handleChange}
                fullWidth={true}
                value={description}
                placeholder="Title"
                multiline={true}
              />
            </Box>
          </Grid>
        </Grid>
      </Box>
    </Paper>
  );
};

export default Frame;
